--Create Company Sectors
--================================
CREATE TABLE [dbo].[DummyTradingSector](
	 [Id]				UNIQUEIDENTIFIER	NOT NULL DEFAULT NEWID()
	,[Name]				VARCHAR(400)		NOT NULL
 ,CONSTRAINT [PK_DummyTradingSectorId] PRIMARY KEY CLUSTERED ([Id] ASC) ON [PRIMARY])

INSERT INTO [dbo].[DummyTradingSector]
	([Name])
VALUES
	('Communication Services'),
	('Consumer Discretionary'),
	('Consumer Staples'),
	('Energy'),
	('Financials'),
	('Health Care'),
	('Industrials'),
