 --Create Company Names
--================================ 
CREATE TABLE [dbo].[DummyTradingCompany](
	 [Id]				UNIQUEIDENTIFIER	NOT NULL DEFAULT NEWID()
	,[ASXCode]			VARCHAR(200)		NOT NULL
	,[Name]				VARCHAR(400)		NOT NULL
	,[SectorId]			UNIQUEIDENTIFIER	NOT NULL
 ,CONSTRAINT [PK_DummyTradingCompanyId] PRIMARY KEY CLUSTERED ([Id] ASC) ON [PRIMARY]
 	,CONSTRAINT [FK_DummyTradingCompanySectorId_TradingSectorId]
		FOREIGN KEY([SectorId])
		REFERENCES [DummyTradingSector]([Id])
	)
	
